import Dropzone from 'react-dropzone'

import { DropContainer, useDropzone /* UploadMessage */ } from './styles'

function Upload() {
    const {acceptedFiles, getRootProps, getInputProps} = useDropzone();
	return (
		<Dropzone accept='image/*' onDropAccepted={() => {}}>
			{(
				getRootProps,
				getInputProps,
				isDragActive,
				isDragReject
			) => (
				<DropContainer
					{...getRootProps()}
					isDragActive
					isDragReject>
					<input {...getInputProps()} />
				</DropContainer>
			)}
		</Dropzone>
	)
}

export default Upload
